import React from 'react';
import { Row,Col } from 'react-bootstrap';
import products from '../../products_and_images/products'


const HomeScreen = () => {
  return (
    <>
      <h1>Latest Products</h1>
      <Row>
      {products.map(item=>(
          <Col cm={12} md={6} lg={4}>
          name={item.name}
          </Col>
      ))}
      </Row>
    </>
  );
}

export default HomeScreen;
